import React from "react";
import { Tab, Tabs, TabList, TabPanel } from "react-tabs";

function App() {
  return;
  <Tabs>
    <TabList>
      <Tab>Title 1</Tab>
      <Tab>Title 2</Tab>
    </TabList>

    <TabPanel>
      <h2>Any content 1</h2>
    </TabPanel>
    <TabPanel>
      <h2>Any content 2</h2>
    </TabPanel>
  </Tabs>;
}

export default App;
